import Home from "./pages/Home";
import Ring from './pages/Ring';
import Docs from "./pages/Docs";

import { BrowserRouter as Router, Routes, Route, Link, Outlet } from 'react-router-dom';


function OwnUserProfile() {
  return <h2>OwnUwerProfile</h2>;
}

function UserProfile() {
  return <h1>UserProfile</h1>;
}


const cars = [
  {id: 1, brand: 'Ford', sub:["abc","def","ghi"]},
  {id: 2, brand: 'BMW', sub:["abc","def","ghi"]},
  {id: 3, brand: 'Audi', sub:["abc","def","ghi"]}
];



function App() {
  return (
    <Router>
      <div>
        <div>
          <Link to="/"></Link>
        </div>
        <div>
          <Link to="/ring"></Link>
        </div>
      </div>
      <Routes>
        <Route path="/" element={<Home />}>
        </Route>
        <Route path="/ring" element={<Ring />}>
        </Route>
        <Route path="docs" element={<Outlet/>}>
          {
            cars.map((car) => <Route path={car.brand} element={<Docs/>}>
              {
                car.sub.map((item)=> <Route path={item} element={<OwnUserProfile/>}/> )
              }
            </Route>)
          }
        </Route>
      </Routes>
    </Router>
  );
}



export default App;
